import { GeneralActionTypes } from './../../types/redux.types';

export const loadOn = () => {
    return ({ type: GeneralActionTypes.START_LOADING })
}
export const loadOff = () => {
    return ({ type: GeneralActionTypes.FINISH_LOADING })
}
